import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { useState, useEffect } from 'react';
import { red } from '@material-ui/core/colors';
import DeleteIcon from "@material-ui/icons/Delete";


const useStyles = makeStyles((theme) => ({
    //fame
    mainFame: {
        width: 755,
        height: 721,
        backgroundColor: '#FFFFFF',
        position: 'relative',
        border: '1px solid #AAAAAA',
        borderRadius: 5

    },
    mainFameHeader: {
        height: 85,
        width: "100%",
        borderBottom: '1px solid #AAAAAA'
    },
    inFame: {
        width: 605,
        height: 307,
        position: 'relative',
        borderRadius: '5px',
        border: '1px solid #AAAAAA'

    },
    inFameHeader: {
        width: "100%",
        height: 86.5,
        borderBottom: '1px solid #AAAAAA',

    },
    //row in fame
    rominfame: {
        width: '100%',
        height: 55,
        position:'relative'
    },
    //wrap infame
    wrapfame: {
        width: 605,
        minHeight: 360,
        margin: 'auto',
        position: 'relative'
    },
    //text
    title: {
        fontSize: '22.6px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
        top: 26.6,
        left: 42
    },
    title2: {
        fontSize: '19.4px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
    },
    title3: {
        fontSize: '16.18px',
        color: '#4A4A4A',
        fontWeight: 'bold'
    },
    title4: {
        fontSize: '13px',
        color: '#4A4A4A',
        fontWeight: 'bold'
    },
    title5: {
        fontSize: '13px',
        color: '#4A4A4A',
    },

    //input
    inputSize: {
        height: 31.5,
        width: 189,
        fontSize: '16px',
        color: '#4A4A4A',
        position: 'relative', 
        margin: 'auto'
    },

    //button
    buttonDelete: {
        width: 35,
        height: 35,
        borderRadius: 17.5,
        backgroundColor: '#F8F8F8',
        position: 'relative'
    },


    //decor
    decorLeftRight: {
        width: 51
    },


}));

export default function CreateRoomRe() {
    const classes = useStyles();


    return (
        <div style={{ position: 'absolute', top: 40 }}>

            <div className={classes.mainFame}>

                <div className={classes.mainFameHeader}>

                    <div className={classes.title} >
                        Rooms
                    </div>

                </div>






                <div className={classes.wrapfame}>

                    <div style={{ position: 'relative', height: 76 }}>
                        <div className={classes.title2} style={{ position: 'relative', top: 20 }}>
                            Building Name props
                        </div>
                    </div>
                    {/* map floor here*/}

                    <div className={classes.inFame}>
                        {/* //linedivider */}



                        <div className={classes.inFameHeader}>
                            <div className={classes.title3}>
                                Floor Number props
                            </div>

                            {/* display flex */}
                            <div style={{ display: 'flex' }}>
                                <div className={classes.title4}>
                                    Room
                                </div>
                                <div className={classes.title4}>
                                    Edit Name Room
                                </div>
                                <div className={classes.title4}>
                                    Delete
                                </div>
                            </div>
                        </div>



                        {/* map room here */}
                        <div className={classes.rominfame} style={{backgroundColor: 'lightBlue'}}>
                            {/* display flex */}
                            <div style={{ display: 'flex' }}>
                                <div className={classes.title5}>
                                   101
                                </div>
                                <input className={classes.inputSize} >

                                </input>
                                <div className={classes.buttonDelete}>
                                    <DeleteIcon style={{color: '#4A4A4A', position: 'absolute', margin:'auto'}}/>
                                </div>
                            </div>
                        </div>

                    </div>
                </div>






            </div>
        </div>
    )
}
